import classes from './TaskForm.module.css'
const TaskForm = (props) => {
  const submitHandler = (event) => {
    event.preventDefault();
  }
  return (
    <form className={classes.form} onSubmit={submitHandler}>
      <input type='text' />
      <button>Add Task</button>
    </form>
  )
}
export default TaskForm;
